(17, 'Parth Gabani', '\"Webito Infotech developed an android version of an existing iOS app of mine. Developing the original iOS version was a complicated process, and took longer to complete than any of us anticipated. But throughout the process everyone at Webito Infotech worked diligently to make sure that the app was working smoothly. \"', 0, 0, '1621831140-Parth Gabani.jpg', '2021-05-23 23:09:00', '2021-05-23 23:09:00'),
(19, 'Jenil Tejani', '\"I must tell Webito\'s team is superb. I was very happy with the development, communication and budget. He is always available for communication and reliable resource to get your mobile application development done. I have given him my iOS application development work also. Now we are working together on further updates on both application. ”', 0, 0, '1621831296-Jenil Tejani.jpg', '2021-05-23 23:11:36', '2021-05-23 23:11:36'),
(20, 'Nevil', '\"Hi, Webito Infotech is professional company, They delivered the project on time & same budget. They are very cooperative and do what exactly what I request. Also they are patients because I change many times the design and they do all things. They also understand and let me pay the minimum milestone I’m very happy to choose Webito \"', 0, 0, '1621831383-Nevil.jpg', '2021-05-23 23:13:03', '2021-05-23 23:13:03'),
(23, 'Shruti Moradiya', 'Webito Team', 0, 1, '1640280281-Shruti Moradiya.webp', '2021-12-23 17:24:42', '2021-12-23 17:25:07');
