INSERT INTO `work_slider` (`id`, `name`, `review`, `year`, `image`, `created_at`, `updated_at`) VALUES
(1, 'Cardddle', 'Cardddle is a user-friendly digital business card app that provides a seamless way to create and share professional-looking cards. Its easy sharing options through email, text, QR code, or social media make it convenient to connect with potential clients or partners. Cardddle is a versatile tool that is suitable for any business professional who wants to create a digital business card.', '2023', '4.png', '2023-04-26 23:02:56', '2023-04-27 00:24:01'),
(2, 'Webisheet', 'Webisheet is an intuitive and user-friendly resume maker application designed to help job seekers create professional-looking resumes quickly and easily. The app offers a variety of styles, and formatting options to suit different preferences and needs.With Webisheet, users can create a stunning resume in just a few minutes, making it an ideal choice for anyone looking for a hassle-free way to create and easily share them with potential employers via email or other platforms.', '2023', '5.png', '2023-04-27 01:21:12', '2023-04-27 01:21:12'),
(3, 'Care2X', 'Care2x is a reputable repair and maintenance company that specializes in fixing a wide range of electronic devices such as phones, laptops, and tablets. They have a team of skilled technicians who use advanced tools and techniques to diagnose and repair devices quickly and efficiently. The company is committed to providing top-quality services. Overall, Care2x provides reliable and prompt repair services for such electronic devices.', '2023', '6.png', '2023-04-27 07:02:35', '2023-04-27 07:02:35');
